import * as s from "./Sidebar_style";
import { useState } from "react";

const Sidebar = () => {

  const backgroundImage =
    "https://images.unsplash.com/photo-1569982175971-d92b01cf8694?ixlib=rb-1.2.1&ixid=MXwxMjA3fDB8MHxleHBsb3JlLWZlZWR8M3x8fGVufDB8fHw%3D&w=1000&q=80";
  const sidebarMenu = [
    { name: "Admin", to: "/", submenu: [], icon: "fa fa-home" },
    { name: "Company", to: "/", submenu: [], icon: "fa fa-eject" },
    { name: "Employee", to: "/", submenu: [], icon: "fa fa-user-secret" },
    { name: "Employeer", to: "/", submenu: [], icon: "fa fa-building-o" },
    { name: "Warehouse", to: "/", submenu: [], icon: "fa fa-wrench" },
    { name: "Contracts", to: "/", submenu: [], icon: "fa fa-handshake-o" },
    { name: "Company", to: "/", submenu: [], icon: "fa fa-wrench" },
  ];
  const [selected , setSelected] =  useState(sidebarMenu[0].name)
  const handleSidebarMenu = sidebarMenu.map((item, index) => {
    return (
      <s.MenuItem key={index++}>
        <s.Icon>
          <i className={item.icon}></i>
        </s.Icon>
        <s.Text>{item.name}</s.Text>
      </s.MenuItem>
    );
  });
  return (
    <s.Container backgroundImage={backgroundImage}>
      <s.Image src="https://w7.pngwing.com/pngs/247/564/png-transparent-computer-icons-user-profile-user-avatar-blue-heroes-electric-blue.png" />
      <s.sidebarHeader>Dashboard</s.sidebarHeader>
      <s.menuContainer>{handleSidebarMenu}</s.menuContainer>
    </s.Container>
  );
};

export default Sidebar;
